import React from 'react';
import './index.css';
function Card(props)
{
    const [users,setUsers]=useState([]);

    useEffect(()=>{
        async function getData(){
        
            const res=await axios.get(`http://127.0.0.1:8000/productapi/khaadi-female/?page=1`)
            setUsers(res);

        }

        getData();
    }),[];




    return (<>
        <h1>Product details</h1>
    
        {
        users.map((val)=>{
        return  (
            <Card
            key={val.id}
            imgsrc={val.imagelink}
            title={val.title}
            sname={val.brand_name}
            link={val.product_link}
            price={val.price}  
            />
           )
        }
        
        )}
        
        </>)    


    }
export default Card;
